snippet.textOriginal:
@Cleetus (Sales) See if you can get Ear Plugs with FF Logo on them (quick search only had printed packaging).
Low $ compared to Tshirts but profit margin is high, for sure high on non-logo. Only 12-cents a pair for box of 200 last time I got Howard Leight Max-1 (what I use on dyno and racing).
Gotta be CHEAP when buying thousands and very little space needed at Track, Trailer and Store.

@Cleetus McFarland there is something special with you doing so much work yourself. You can see how genuine you are and how excited you are... Reminds me of times when I was young.


I see inspiration you're putting down for everyone... never give up, work hard for what you love and one day you will look at work differently. I am totally envious of what you have achieved, wish I could be apart of something so great.


Your parents deserve a lot of credit, they have raised one heck of a freedom loving hard working "Florida Man". Look forward to watching this all develop into greatness. I can see  your dream in every video of the FF through your eyes out of how passionate you are... First the bathrooms and now the bleachers... I look forward to seeing the next thing you discover a newfound passion for!
